import { useNavigate } from 'react-router-dom'

export default function Portal() {
    const navigate = useNavigate()
  return (
    <>
    <button onClick={() => navigate ("advocates")}>Advocates login</button>
    <button onClick={() => navigate ("guardian")}>Guardian login</button>

    </>
  )
}
